import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import {
  mapPlx,
} from '../plxSettings'

const StyledSlideThree = styled.div`
  position: relative;
  height: 100vh;
  width: 100vw;

  .map-plx {
    opacity: 0;
    position: absolute;
    bottom: 0;
    right: 0;
    left: 90%;
    width: 60vw;

    #map-img {
      width: 100%
    }
  }

  .image-wrapper {
    position: absolute;
    top: calc(100% / 5);
    right: 120px;
    display: inline-block;

    #car-img {
      position: absolute;
      bottom: 0px;
      left: -20vw;
      width: 40vw;
    }

    #app-img {
      position: absolute;
      right: calc(100% / 2 - 18vw );
      top: -11vh;
      width: 25vw;
    }
  }
`;

function SlideThree() {
  return (
    <StyledSlideThree>
      <Plx
        className='map-plx'
        parallaxData={mapPlx}
      >
        <img id='map-img' src='images/map.png' alt='map of route' />
      </Plx>
      {/* <div className='image-wrapper'>
        <img id='app-img' src='images/app_screen_2.png' alt='mobile device with Eleanor app' />
        <img id='car-img' src='images/silver_car.png' alt='silver sports car' />
      </div> */}
    </StyledSlideThree>
  );
}

export default SlideThree;
